INSERT INTO `source_code` VALUES (1001,'#include <stdio.h>\nint main() {int a, b;\n    scanf(\"%d%d\", &a, &b);\n    printf(\"%d\\n\", a + b);\n    return 0;\n\n}'),(1002,'#include\n \nint main() {\n    int a, b;\n    scanf(\"%d%d\", &a, &b);\n    printf(\"%d\\n\", a + b);\n    return 0;\n}'),(1003,'import java.util.Scanner;\n\npublic class Main {\n    static int N,B,D;\n	public static void main(String[] args) {\n		Scanner scan = new Scanner(System.in);\n		N = scan.nextInt();\n		B = scan.nextInt();\n		D = scan.nextInt();\n		\n		int[] result = new int[N];\n		result[0]=0;\n		for(int i=1;i<N;i++){\n			int index=1;\n			while(index<=Math.pow(2, B)){\n				boolean isHamming = true;\n				for(int j=0;j<i;j++){\n					if(getHammingDis(result[j],index)==false){\n						isHamming = false;\n						break;\n					}\n				}\n				if(isHamming == true){\n					result[i] = index;\n					break;\n				}\n				index++;\n			}\n		}\n		for(int i=0;i<N;i++){\n			System.out.print(result[i]+\" \");\n		}\n	}\n    \n	\n	public static boolean getHammingDis(int a,int b){\n		int difNum = 0 ;\n		for(int i=0;i<B;i++){\n			int a1 = a&(1<<i);\n			int b1 = b&(1<<i);\n			if(a1!=b1)\n				difNum ++;\n			if(difNum>=D)\n				return true;\n		}\n		\n		return false;\n	}\n}'),(1004,'import java.util.Scanner;\n\npublic class Main {\n    static int N,B,D;\n	public static void main(String[] args) {\n		Scanner scan = new Scanner(System.in);\n		N = scan.nextInt();\n		B = scan.nextInt();\n		D = scan.nextInt();\n		\n		int[] result = new int[N];\n		result[0]=0;\n		for(int i=1;i<N;i++){\n			int index=1;\n			while(index<=Math.pow(2, B)){\n				boolean isHamming = true;\n				for(int j=0;j<i;j++){\n					if(getHammingDis(result[j],index)==false){\n						isHamming = false;\n						break;\n					}\n				}\n				if(isHamming == true){\n					result[i] = index;\n					break;\n				}\n				index++;\n			}\n		}\n		for(int i=0;i<N;i++){\n			System.out.print(result[i]);\n			System.out.print(\" \");\n		}\n	}\n    \n	\n	public static boolean getHammingDis(int a,int b){\n		int difNum = 0 ;\n		for(int i=0;i<B;i++){\n			int a1 = a&(1<<i);\n			int b1 = b&(1<<i);\n			if(a1!=b1)\n				difNum ++;\n			if(difNum>=D)\n				return true;\n		}\n		\n		return false;\n	}\n}'),(1005,'import java.math.BigDecimal;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		Scanner cin=new Scanner(System.in);\n        while(cin.hasNext())\n        {\n            BigDecimal r=cin.nextBigDecimal();\n            int n=cin.nextInt();\n            r=r.pow(n).stripTrailingZeros();//\n            String m_string=r.toPlainString();//\n            if(m_string.charAt(0)==\'0\')\n            m_string=m_string.substring(1);\n            System.out.println(m_string);\n        }\n\n	}\n\n}'),(1006,'#include <iostream>\nusing namespace std;\n#define ULL unsigned long long\n\nULL mul_mod (ULL a, ULL b, ULL c) \n{\n    ULL res = 0;\n    for ( ; b; b >>= 1)\n    {\n        if (b & 1)\n        {\n            res += a;   \n            if (res >= c) res -= c;\n        }\n        a <<= 1;    \n        if (a >= c) a -= c;\n    }\n    return res;\n}\n\nULL qmod (ULL a, ULL b, ULL c)\n{\n    ULL res = 1;\n    for ( ; b; b >>= 1)\n    {\n        if (b & 1)\n            res = mul_mod (a, res, c);\n        a = mul_mod (a, a, c);\n    }\n    return res;\n}\n\nint main()\n{\n    ULL a, b, c;\n    if (~scanf (\"%lld%lld%lld\", &a, &b, &c))\n        printf (\"%lld\\n\", qmod (a%c, b, c));\n    return 0;\n}\n'),(1007,'import java.util.*;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		ArrayList<Long> inputs = new ArrayList<Long>();\n		Scanner scan = new Scanner(System.in);// \n		long num1 = 0, num2 = 0;\n\n		if (scan.hasNextLine()) {\n			String inputStr = scan.nextLine();\n			String[] vars = inputStr.split(\" \");\n			for (int i = 0; i < vars.length; i++) {\n				long temp = Long.valueOf(vars[i]);\n				inputs.add(temp);\n				if (num1 == 0)\n					num1 = temp;\n				else {\n					num2 = temp;\n					num1 = maxCommonDivisor(num1, num2);\n				}\n\n			}\n\n			System.out.println(num1);// maxCommonDivisor()\n			System.out.println(minCommonMultiple(inputs, num1));// minCommonMultiple()\n		}\n	}\n\n	// \n	public static long maxCommonDivisor(long m, long n) {\n		if (m < n) {// m>n,m<n,\n			long temp = m;\n			m = n;\n			n = temp;\n		}\n		if (m % n == 0) {// 0,\n			return n;\n		} else { // ,,nm,n\n			return maxCommonDivisor(n, m % n);\n		}\n	}\n\n	// \n	public static long maxCommonDivisor2(long m, long n) {\n\n		if (m < n) {// m>n,m<n,\n			long temp = m;\n			m = n;\n			n = temp;\n		}\n		while (m % n != 0) {// 0,\n			long temp = m % n;\n			m = n;\n			n = temp;\n		}\n		return n;// \n	}\n\n	// \n	public static long minCommonMultiple(long m, long n) {\n		return m * n / maxCommonDivisor(m, n);\n	}\n\n	// \n	public static long minCommonMultiple(ArrayList<Long> array, long maxDivisor) {\n		long min = minCommonMultiple(array.get(0),array.get(1));\n		for (int i = 2; i < array.size(); i++) {\n			min = minCommonMultiple(array.get(i),min);\n		}\n\n		return min;\n	}\n\n}\n'),(1008,'import java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String argv[]) {\n\n		Scanner scan = new Scanner(System.in);\n		int N = scan.nextInt();\n		if(isPrime(N)){\n			System.out.print(\"YES\");\n		}else\n			System.out.print(\"NO\");\n\n	}\n\n	private static boolean isPrime(int n) {\n		if (n <= 1) {\n			return false;\n		}\n		int k = (int) Math.sqrt(n);\n		for (int i = 2; i <= k; i++) {\n			if (n % i == 0) {\n				return false;\n			}\n		}\n		return true;\n	}\n\n}'),(1009,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Summing {\n\n	public static void main(String[] args) {\n		ArrayList<Integer> inputs = new ArrayList<Integer>();\n		Scanner scan = new Scanner(System.in);\n		while(scan.hasNext()){\n			String str = scan.nextLine();\n			try{\n				int i = Integer.valueOf(str);\n				inputs.add(i);\n			}catch(NumberFormatException e){\n				break;\n			}\n		}\n		scan.close();\n        int 